THE DEMON BEHEMOTH 
 
Behemoth-a demon who ran feasts in hell. 
At the court of the Lord, he leads feasts and is the night watchman of the Underworld. Also, many consider him to be, and revere as Great Cup-bearer. 
This demon is one of the most cruel executioners of Hell, and sinners tremble when they hear his trumpet from afar. In addition, the Hippo is also known for its singing. 
 
Behemoth is a demon of gluttony, and considers it his duty to evoke animal tendencies in a person, prompting the desire to blaspheme and swear. 
 
The best Baker and pastry chef in the hell, he has no equal. Which is funny: if it wasn't for his rank and the amount of work on his hellish post, he would have opened his pastry shop long ago and gone to work there. 
 
It can change its size and take the form of large animals, but prefers small stature and human appearance with horns to evoke charm and ingratiate itself with trust. That's why he's one of hell's favorites. Perhaps it is difficult to find the demon who does not like this fat man. By the way, because of his weight and height, he has two problems: he can not climb on sofas, chairs, etc., without help, and he moves very clumsily, puffing and leaning on his cane.
 
Very polite, tactful, and accurate, in relation to demons, especially to ladies and archdevils standing above him. But the word "people" just turns him off, so before being imprisoned in hell, he liked to do mischief of various scales. Sometimes, almost reaching worldwide publicity.

